    body: {string: "{\n  \"head\": {\n    \"vars\": [ \"abstract\" ]\n  } ,\n  \"\
        results\": {\n    \"bindings\": [\n      {\n        \"abstract\": { \"type\"\
        : \"literal\" , \"value\": \"Background Francisella tularensis, the causative\
        \ agent of tularemia, is a zoonotic agent that remains across much of the\
        \ northern hemisphere, where it exists in enzootic cycles. In Ukraine, tularemia\
        \ has a long history that suggests a need for sustained surveillance in natural\
        \ foci. To better characterize the host-vector diversity and spatial distribution\
        \ of tularemia, we analyzed historical data from field collections carried\
        \ out from 1941 to 2008.FindingsWe analyzed the spatial-temporal distribution\
        \ of bacterial isolates collected from field samples. Isolates were characterized\
        \ by source and dominant land cover type. To identify environmental persistence\
        \ and spatial variation in the source of isolation, we used the space-time\
        \ permutation and multinomial models in SaTScan. A total of 3,086 positive\
        \ isolates were taken from 1,084 geographic locations. Isolation of F. tularensis\
        \ was more frequent among arthropods [n\xBF=\xBF2,045 (66.3%)] followed by\
        \ mammals [n\xBF=\xBF619 (20.1%)], water [n\xBF=\xBF393 (12.7%)], and farm\
        \ produce [n\xBF=\xBF29 (0.94%)], respectively. Four areas of persistent bacterial\
        \ isolation were identified. Water and farm produce as sources of bacterial\
        \ isolation were clustered.ConclusionsOur findings confirm the presence of\
        \ long-standing natural foci of F. tularensis in Ukraine. Given the history\
        \ of tularemia as well as its environmental persistence there exists a possibility\
        \ of (re)emergence in human populations. Heterogeneity in the distribution\
        \ of tularemia isolate recovery related to land cover type supports the theory\
        \ of natural nidality and clusters identify areas to target potential sources\
        \ of the pathogen and improve surveillance.\" }\n      }\n    ]\n  }\n}\n"}
